  input: '"TEXT","F3XA","C00140590","FEC  Laura Sinram     RE California Republican
    Party /V8  ID C00140590  April Monthly (3/1/07- 3/31/07)    Dear Ms. Sinram    In
    response to your inquiry dated November 16, 2007 listed below are our responses.  We
    have filed an amended report which updates some of the missing contributor information.
    Please note that we enter the name of employer and occupation exactly as the donor
    represents it to us. However we have taken steps to ensure that the best efforts
    procedure, which is outlined in detail below, will also be followed when the donor
    responds; but responds inadequately. For example when they respond self/ business
    owner as their overall response, the committee will send up a follow up letter
    as outlined below. We will also send a follow up letter to those descriptions
    which you felt were not sufficient.  We believe  self/Attorney  is an adequate
    response as many attorneys are sole practioners operating under just their name.    Listed
    below is our committees procedures to address the disclosure issue regarding contributions.   First,
    our original solicitation does include a clear and conspicuous request for the
    contributor information and does inform the contributor of the requirements of
    Federal Law for such reporting information.    Second, when contributions are
    received with the requesting information not provided; we send a separate letter,
    which clearly asks for the missing information without soliciting a contribution.  We
    once again inform the contributor of the requirements of the Federal Law for the
    reporting of such information and we provide a return envelope for the benefit
    of the contributor.      We file amended reports when we receive  updated information.      In
    response to your inquiry for wages paid to employees who spend more than 25 %
    of their time on either federal election activity or in connection with a federal
    election were recorded on Line 21 b and are paid with 100% federal  dollars. There  entries
    on line 21 b for the month in question have been moved to line 30b. No other employees
    spend more than 25% of their time on either fea or activities in connection with
    a federal election  In response to your inquiry regarding salaries and fringe
    benefits for Burch & Huang which were reported on h4; please note that these were
    employees who spent less than twenty five percent of their time on FEA or activities
    in connection with a federal election.     You also inquired about payments for
    registering voters, which the committee reported on line 21(b). Those payments
    were part of the committees paid voter registration drive and not related to any
    activity that promoted or opposed particular federal candidate. Based on the above
    the committee believes it is complying with the best efforts requirements of the
    law.  Please note due to a computer glitch, the admistrative activity code is
    listed as b1 not 2007 admin for all activity on this report. This code is correctly
    pulling items at the 72 and 28% ratio.  Sincerely,  Fred Arjani        "'
